import React, {useState} from 'react';
import styles from '../styles/createpostpage.module.scss';
import PlacesAutocomplete from 'react-places-autocomplete';

function CreatePostPage() {
    const [address, setAddress] = useState('');

    const handleChange = (address: string) => {
        setAddress(address);
    };

    const handleSelect = (address: string) => {
        setAddress(address);
    };

    return (
        <div className={styles.pageContainer}>
            <div className={styles.formContainer}>
                <form>
                    <div className={styles.formGroup}>
                        <label htmlFor="title">제목</label>
                        <input type="text" id="title" placeholder="제목" />
                    </div>
                    <div className={styles.formGroup}>
                        <label htmlFor="date">날짜</label>
                        <input type="date" id="date" placeholder="날짜"/>
                    </div>
                    <div className={styles.formGroup}>
                        <label htmlFor="time">시간</label>
                        <input type="time" id="time" placeholder="시간"/>
                    </div>
                    <div className={styles.formGroup}>
                        <label htmlFor="location">장소</label>
                        <PlacesAutocomplete
                            value={address}
                            onChange={handleChange}
                            onSelect={handleSelect}
                        >
                            {({getInputProps, suggestions, getSuggestionItemProps, loading}) => (
                                <div>
                                    <input
                                        {...getInputProps({
                                            placeholder: '주소로 검색하세요.',
                                            className: 'location-search-input',
                                        })}
                                    />
                                    <div className="autocomplete-dropdown-container">
                                        {loading && <div>Loading...</div>}
                                        {suggestions.map((suggestion) => {
                                            const className = suggestion.active
                                                ? 'suggestion-item--active'
                                                : 'suggestion-item';
                                            // inline style for demonstration purpose
                                            const style = suggestion.active
                                                ? {backgroundColor: '#fafafa', cursor: 'pointer'}
                                                : {backgroundColor: '#ffffff', cursor: 'pointer'};
                                            return (
                                                <div
                                                    {...getSuggestionItemProps(suggestion, {
                                                        className,
                                                        style,
                                                    })}
                                                >
                                                    <span>{suggestion.description}</span>
                                                </div>
                                            );
                                        })}
                                    </div>
                                </div>
                            )}
                        </PlacesAutocomplete>
                    </div>
                    <div className={styles.formGroup}>
                        <label htmlFor="people">인원 수</label>
                        <select id="people" className={styles.select}>
                            <option value="" disabled selected>인원 수</option>
                            <option value="1">1명</option>
                            <option value="2">2명</option>
                            <option value="3">3명</option>
                            <option value="4">4명</option>
                            <option value="5">5명</option>
                            <option value="6">6명</option>
                            <option value="7">7명</option>
                            <option value="8">8명</option>
                            <option value="9">9명</option>
                            <option value="10">10명 이상</option>
                        </select>
                    </div>
                    <div className={styles.formGroup}>
                        <label htmlFor="description">자세한 설명</label>
                        <textarea id="description" placeholder="자세한 설명을 입력해주세요."/>
                    </div>
                    <div className={styles.buttonGroup}>
                        <button type="button" className={styles.submitButton}>작성완료 ➔</button>
                    </div>
                </form>
            </div>
        </div>
    );
}

export default CreatePostPage;
